import React from 'react'
import { AiFillHome } from 'react-icons/ai'

const Navbar = () => {
    return(
        <div className="navbar_div">
            <AiFillHome style={home_btn}/>
        </div>
    );
}


const home_btn = {
    height: "6vh",
    width: "6vh",
    marginTop: "1vh",
    paddingLeft: "5vw"
}
export default Navbar
